import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';

function FixedImage({ src, alt }) {
  const navigate = useNavigate();
  const location = useLocation();

  const handleClick = () => {
    navigate('/about');
  };

  if (location.pathname !== '/') {
    return null;
  }

  return (
    <img
      src={src}
      alt={alt}
      onClick={handleClick}
      style={{
        cursor: 'pointer',  
        position: 'fixed',
        bottom: '20px',
        right: '20px',
        width: '100px',
      }}
    />
  );
}

export default FixedImage;
